# Read two integers from input
x, a = map(int, input().split())

# If x is less than a, print 0; otherwise, print 10
if x < a:
    print(0)
else:
    print(10)


def main():
    # Read input
    x, a = [int(i) for i in input().split()] # input() returns a string, so you have to convert it to int.

    # Compare the two values and print the result
    if x < a:
        print(0)
    else:
        print(10)

if __name__ == '__main__':
    main()
